import React  from "react";
import Card from './bo'


const Cardlist = ({robots}) => {
   
   if(true) {
     throw new Error("noooooo") }

    return(
        
        <div>
      {
       robots.map(( user,i) => {
        return (
              <Card  key={i} 
            id={robots[i].id } 
            name={robots[i].name} 
            email={robots[i].email}
            />
             );
         })
    }
        
        </div>

    );
}

export default Cardlist ;
